import React, {Component} from "react";
import ReactDOM from 'react-dom';
import './index.css';

import{
BrowserRouter as Router,
Routes,
Route,
Link,
Redirect
} from "react-router-dom"

import OfertAdd from "./OfertAdd";
import Categories from "./Categories";
import Mainbar from "./Mainbar";
import Hello from "./Hello";
import Register from "./Register";
import Login from "./Login";
import Error from "./Error";
import CategoryOption from "./CategoryOption";
import Example from "./Example";
import NameForm from "./NameForm";
import aboutUserText from "./AboutUserText";

class App extends Component{render(){
  return(
  <Router>
    <Routes>
      <Route path='/' element={<div><Example/><aboutUserText /><Mainbar/><Hello login="studencie" /> <Categories /> <Register/> <Login /><OfertAdd /></div>} />
      <Route path={'/dom'} element={<CategoryOption /> } />
      <Route path={'/login'} element={<Login /> } />
      <Route path='*' element={<Error /> } />
    </Routes>
    </Router>);}
}
ReactDOM.render(<App/>,document.getElementById('root'));
